import { useNavigate } from "react-router-dom";
import React, { Component } from "react";
import {
  ProductsContainer,
  ProductsWrapper,
  ProductsCard,
  ProductsIcon,
  ProductsH1,
  ProductsH2,
  ProductsP,
} from "./ProductElements";
import Icon1  from '../../common/assets/asset.svg';
import Icon2 from '../../common/assets/liability.svg'
import DataViz1 from '../../common/assets/data-1.png';
import DataViz2 from '../../common/assets/data-2.png';
import DataViz3 from '../../common/assets/data-3.png';

function NewProduct() {
    const navigate = useNavigate();
    const data=[
      {"name":"asset","id":"1"},
      {"name":"liability","id":"2"}
    ]
    const handleClick = (event,param) => {
        navigate(`/createnewcontract/${param}`);
      };
  return (
    <>
      <ProductsContainer id="newproduct" style={{background: "#f9f9f9", display: "flow-npm root"}}>
        <ProductsH1 style={{color: "#010606"}}> Train and Test Results of Machine Learning Models </ProductsH1>
        <ProductsWrapper style={{gridTemplateColumns: "1fr 1fr"}}>
        <ProductsCard>
                      <ProductsIcon src={DataViz1} />
                      <ProductsH2>Pair Plots Visualization</ProductsH2>
                      <ProductsP>Pair Plot visualization for each pair of features</ProductsP>
                    </ProductsCard>
                    <ProductsCard>
                      <ProductsIcon src={DataViz2} />
                      <ProductsH2>Heat Maps Visualization</ProductsH2>
                      <ProductsP>HeatMap Visualization for each pair of features</ProductsP>
                    </ProductsCard>
                    <ProductsCard >
                      <ProductsIcon src={DataViz3} />
                      <ProductsH2>Distribution Plot Visualization</ProductsH2>
                      <ProductsP>Distribution Plot  Visualization for each feature</ProductsP>
                    </ProductsCard>
        </ProductsWrapper>
      </ProductsContainer>
    </>
  );
}

export default NewProduct;
